NEU Ein Bildungsgang bezeichnet eine spezifische schulische Laufbahn, die zu einem bestimmten Abschluss oder einer Qualifikation führt. Innerhalb dieser Laufbahn werden mehrere Schulstufen durchlaufen, deren Dauer durch den Bildungsgang definiert ist. Er erfordert das Erreichen eines definierten Kompetenzprofils, welches durch verschiedene Arten der Leistungsfeststellung überprüft wird. Im Lehrplan werden die zu prüfenden Inhalte und Kompetenzen der jeweiligen Fächer festgelegt.  
In der Ontologie unterscheiden wir im Bereich der allgemeinbildenden Schulen zwischen drei Bildungsgängen: 
Der Hauptschulbildungsgang, der zum Ersten Schulabschluss führt;
der Realschulbildungsgang, der zum Mittleren Schulabschluss führt;
der gymnasiale Bildungsgang, der zur  Allgemeinen Hochschulreife führt.
